import axios from 'axios'

let initialValue
axios.get('http://localhost:3001/api/users/').then((res) => {
    if (res.status === 200) {
        initialValue = res.data
    }
}).catch(err => alert(err))

const session = (state = initialValue, action) => {
    return state
}
export default session
